/* eslint-disable */
import React from "react";
import {Button, Input} from "antd";
import { useDispatch } from "react-redux";
import { useHistory } from 'react-router-dom'
import { Field, reduxForm } from 'redux-form'
import {email, password, required} from "../../utils/helpers/validators";
// import {Input} from "../../utils/helpers/formControls";

const LoginForm = (props) => {
    let handleSubmit = val => {
        console.log(45, val)
    }
    return (
        <form className="login-form" onSubmit={handleSubmit}>
            <div>
                <Field placeholder={'login'} name={"login"} component={Input}
                       validate={ [email, required] }/>
            </div>
            <div>
                <Field placeholder={'password'} name={"password"} component={Input}
                       validate={[password, required]}
                       type="password"/>
            </div>
            <div>
                <button>Submit</button>
            </div>
        </form>
    )
}

const LoginReduxForm = reduxForm ({ form: 'login'})(LoginForm)

const ParticipantRegisterForm = ({ setState }) => {
    let dispatch = useDispatch();
    const history = useHistory();

    const handleSubmit = (formData) => {
        console.log('formData', formData)
        // RegisterRequest(formData, history)(dispatch);
    }
    return (
        <form className="login-form" onSubmit={handleSubmit}>
            <div>
                <Input placeholder={'login'} name={"login"}
                       validate={ [email, required] }/>
            </div>
            <div>
                <Input placeholder={'password'} name={"password"}
                       validate={[password, required]}
                       type="password"/>
            </div>
            <div>
                <button>Submit</button>
            </div>
        </form>
    );
};





export default ParticipantRegisterForm;
